import '../Styles/App.css';
import Header from './Header';
import Cards from './Cards';
import mydata from '../Assets/Data';

function App() {
  return (<>
    <Header/>,
    <div className=''>
    {
      mydata.map(item => (
        <Cards key={item.key} item={item}/>
      ))
    }
    </div>
    </>
  );
}

export default App;
